/*
135. 分发糖果

老师想给孩子们分发糖果，有 N 个孩子站成了一条直线，老师会根据每个孩子的表现，预先给他们评分。
你需要按照以下要求，帮助老师给这些孩子分发糖果：    每个孩子至少分配到 1 个糖果。
相邻的孩子中，评分高的孩子必须获得更多的糖果。     那么这样下来，老师至少需要准备多少颗糖果呢？

示例 1:   输入: [1,0,2]     输出: 5
解释: 你可以分别给这三个孩子分发 2、1、2 颗糖果。
示例 2:   输入: [1,2,2]     输出: 4
解释: 你可以分别给这三个孩子分发 1、2、1 颗糖果。
     第三个孩子只得到 1 颗糖果，这已满足上述两个条件。
*/

class Solution {
public:
    // 如果数组单调递减
    bool decline(vector<int>& nums){
        int len = nums.size();
        for(int i = 1; i < len; i++)
            if(nums[i] >= nums[i-1]) return false;
        return true;
    }
    int candy(vector<int>& ratings) {
        int len = ratings.size();
        if(decline(ratings)) return len*(len+1)/2;
        vector<int> dp(len, 1);
        // 正走一遍
        for(int i = 1; i<len; i++)
            if(ratings[i] > ratings[i-1]) dp[i] = dp[i-1] + 1;
        int sum = dp[len-1];
        // 反走一遍
        for(int i = len-2; i>=0; i--){
            if(ratings[i] > ratings[i+1]) dp[i] = max(dp[i], dp[i+1]+1);
            sum += dp[i];
        }
        return sum;
        /*
        vector<int> res(len, 0);
        while(num != len){
            for(int i=0; i<len; i++){
                if(res[i] != 0) continue;
                // 当前小孩子比两边的人评分少，所以分最少
                if((i==0 || ratings[i]<=ratings[i-1]) && (i==len-1 || ratings[i]<=ratings[i+1]))
                    num++, res[i] = 1; // 比两边的人一个高，一个低
                else if((i==0 || ratings[i]<=ratings[i-1]) && (i==len-1 || res[i+1] != 0))
                    num++, res[i] = 1 + (i==len-1 ? 0:res[i+1]);
                else if((i==0 || res[i-1] != 0) && (i==len-1 || ratings[i]<=ratings[i+1]))
                    num++, res[i] = 1 + (i==0 ? 0:res[i-1]); // 当前比左右两边的评分高
                else if((i==0 || res[i-1] != 0) && (i==len-1 || res[i+1] != 0))
                    num++, res[i] = 1 + max((i==0 ? 0:res[i-1]), (i==len-1 ? 0:res[i+1]));
            }
        }
        return accumulate(res.begin(), res.end(), 0);
        */
    }
};

int main(){
    vector<int> arr{1,0,2,45,4,45,3,6,56};
    int res = Solution().candy(arr);
    cout<<res<<endl;
    return 0;
}
